import React from "react";
import { NavLink } from "react-router-dom";

import "../CSS/matchSelector.css";
function CompareTypeSelector(props) {
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-4" style={{ marginTop: "10px" }}>
          <NavLink to="/stats">
            <h6 className="">All</h6>
          </NavLink>
        </div>
        <div className="col-4">
          <NavLink to="/compare">
            <h6 className="tab">Compare</h6>
          </NavLink>
        </div>
        <div className="col-4" style={{ marginTop: "10px" }}>
          <NavLink to="/rank">
            <h6>Rank</h6>
          </NavLink>
        </div>{" "}
      </div>
    </div>
  );
}

export default CompareTypeSelector;
